<!DOCTYPE html>
<html>
	<head>
		<title>Inkscape Output</title>
	</head>
	<body>
		<canvas id="canvas" width="1000" height="1000"></canvas>
		<script>
			var ctx = document.getElementById("canvas").getContext("2d");

			// #layer1

			// #path13036
			ctx.translate(100, 100);
			ctx.scale(5, 5);
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(100, 0);
			ctx.bezierCurveTo(100, 0, 90, 0, 90, 10);
			ctx.lineTo(90, 45);
			ctx.lineTo(80, 50);
			ctx.lineTo(90, 55);
			ctx.lineTo(90, 90);
			ctx.bezierCurveTo(90, 90, 90, 100, 100, 100);
			ctx.stroke();

			// #path13038
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 128, 0)";
			ctx.lineWidth = 0.935414;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(5, 5);
			ctx.lineTo(75, 5);
			ctx.lineTo(75, 95);
			ctx.lineTo(5, 95);
			ctx.lineTo(5, 5);
			ctx.stroke();
		</script>
	</body>
</html>
